import React from "react";
import Homepage from "./pages/homepage/homepage.component";
import {Switch,Route} from 'react-router-dom'

function App() {
  return (
    <div>
      <Switch>
      <Route exact='/' component={Homepage}/>
      <Route exact='/home' component={<h2>Hey</h2>}/>
      </Switch>

    </div>
  );
}

export default App;
